Arthur ruimt tafels af in een Chinees restaurant, speelt de trombone in de schoolband en heeft een oogje op de slimme, grappige, bijzondere Lila - die ook een oogje op hem heeft. Maar als Arthur een voorzichtige stap zet in de richting van zijn eerste relatie, beginnen de langdurige relaties van de volwassenen om hem heen te wankelen en storten ze in. Arthur wordt in een maalstroom van gebeurtenissen meegesleurd die zijn wereld voor altijd veranderen.:
